import React from 'react';
import '../style.css';

function Home() {
    return (
        <div className="container mt-5">
            {}
            <div className="jumbotron p-5 bg-light rounded shadow">
                <h1 className="display-4 text-center">Welcome to My Portfolio!</h1>
                <p className="lead text-center">Here you will find information about my education, skills, and projects.</p>
                <h1 className="display-3 text-center">Ella Doane</h1>

            </div>
        </div>
    );
}

export default Home;
